module.exports = "<h3 class=\"heading\">Frequently Asked Question</h3>\n<div id=\"accordion\">\n  <div class=\"alert alert-warning alert-dismissible\" role=\"alert\">\n    <button type=\"button\" class=\"close\" data-dismiss=\"alert\"><span aria-hidden=\"true\">&times;</span><span class=\"sr-only\">Close</span></button>\n    This section contains a wealth of information, on <strong>Frequently Asked Questions</strong> click any question to view the expert asnswer. </div>\n  <div class=\"card\">\n    <div class=\"card-header\" id=\"headingOne\">\n      <h5 class=\"mb-0\">\n        <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"false\"\n          aria-controls=\"collapseOne\">\n          How accurate is the rapid oral HIV test?\n        </button>\n      </h5>\n    </div>\n\n    <div id=\"collapseOne\" class=\"collapse show\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\">\n      <div class=\"card-body\">\n        The rapid oral HIV test detects antibodies made by the immune system in response to HIV infection, just like\n        the standard blood antibody test. The rapid oral test, however, detects these antibodies in oral fluid, and\n        doesn't require a blood sample.\n\n        The rapid oral HIV test is quite accurate (similar to the standard blood antibody test) for persons with\n        chronic, or longstanding, HIV infection, but it is not as accurate for people with new or recent HIV infection.\n        Like any antibody test for HIV, the rapid oral HIV test is not reliable during the \"window period\" (lasting\n        several weeks to months) between the time a person is infected and the time the body has made enough antibodies\n        for the test to detect. During this window period, someone who is infected might test negative for antibodies\n        (a false-negative result). The \"window period\" for the rapid oral test is longer than it is for some HIV blood\n        tests, meaning that for someone with acute or new HIV infection certain blood tests can detect HIV earlier than\n        the oral rapid tests can.\n\n        It also is possible to have false-positive results (a person may have a positive rapid oral HIV test result but\n        not actually be infected with HIV). That's why anyone who has a positive result with a rapid oral HIV test must\n        have a more specific \"confirmatory\" blood test before a diagnosis of HIV infection can be made.\n      </div>\n    </div>\n  </div>\n  <br />\n  <div class=\"card\">\n    <div class=\"card-header\" id=\"headingThree\">\n      <h5 class=\"mb-0\">\n        <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree\" aria-expanded=\"false\"\n          aria-controls=\"collapseThree\">\n          What are the risks of getting HIV if you put on a condom after you've already started having sex?\n        </button>\n      </h5>\n    </div>\n    <div id=\"collapseThree\" class=\"collapse\" aria-labelledby=\"headingThree\" data-parent=\"#accordion\">\n      <div class=\"card-body\">\n        Condoms work well to prevent HIV infection when one partner is HIV infected and the other isn't. Studies show\n        that HIV-uninfected partners are 80% less likely to become infected, if they use condoms properly and\n        consistently, compared with those who do not. Consistent condom use means using a condom for every act of\n        vaginal (penis in vagina) or anal (penis in butt) sex.\n\n        But sometimes sex gets going before the condom goes on. What are the risks to an HIV-negative person if they\n        start having condomless sex with an HIV positive man, but he puts on a condom before he ejaculates?\n\n        For an HIV-negative woman, some studies have suggested that the risk of HIV infection is lower if a male\n        partner withdraws before ejaculating than if he doesn't, but the risk is still higher than it is among those\n        who use condoms properly and consistently. Why? Well, we know that pre-ejaculate, the sticky-yet-slippery clear\n        fluid that a man produces after being sexually aroused but before he ejaculates, can have the virus in it, and\n        in enough amounts to be infectious.\n\n        For an HIV-negative man who has sex with men (MSM), at least one study has shown that the odds of becoming\n        infected with HIV as a result of having receptive anal sex with delayed condom use were about the same as the\n        odds of becoming infected from having anal sex without condoms (or PrEP).\n\n        It's important to mention that PrEP (or pre-exposure prophylaxis), a pill, is very effective at preventing HIV\n        if it is taken every day. This may be a good option for you if you are having trouble using condoms\n        consistently.\n\n        Having condomless sex increases the risk of contracting other sexually transmitted diseases (STDs), such as\n        syphilis, gonorrhea, chlamydia, and genital herpes. Although these infections are treatable and (with the\n        exception of herpes) curable, they often produce no symptoms and can increase the risk of becoming infected\n        with HIV. Hepatitis B and C also can be transmitted through unprotected sex. Using condoms properly and\n        consistently can decrease your risk of contracting these infections as well. And, proper condom use can prevent\n        pregnancy.\n\n        So the bottom line is this: Putting on a condom after you already have started having vaginal or anal sex is\n        more risky than using a condom from the start. If it is difficult to talk about condom use with your partner,\n        then it's time to find someone who can talk with both of you. Many cities have STD clinics and HIV counseling\n        and testing sites that can help partners have these discussions. This also may be a good moment to consider\n        PrEP--discuss this with your VA clinician or your local sexual health clinic.\n      </div>\n    </div>\n  </div>\n  <br />\n  <div class=\"card\">\n    <div class=\"card-header\" id=\"headingTwo\">\n      <h5 class=\"mb-0\">\n        <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo\" aria-expanded=\"false\"\n          aria-controls=\"collapseTwo\">\n          Would you know whether you're infected with HIV without getting tested?\n        </button>\n      </h5>\n    </div>\n    <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\n      <div class=\"card-body\">\n        No. The only way to know if you are infected with HIV is to get tested.\n\n        Although some people do have a flulike illness around the time they get infected, many do not. Also, even if\n        you have a flulike illness from HIV, it's usually pretty difficult to tell it apart from ... the flu. So, even\n        people who have the symptoms of HIV infection may think they just have the flu.\n\n        Many people with HIV infection, including those with AIDS, don't feel or look sick in any way. They find out\n        that they are HIV infected only when they get tested. Sometimes this testing is done as part of routine health\n        exams, like getting your cholesterol checked. Other times, people get tested only when they suddenly become\n        seriously ill with a life-threatening infection, and their doctors need to know whether the infection is a\n        result of a weakened immune system caused by HIV.\n\n        Getting tested for HIV is crucial for protecting your health. It's better to find out you are HIV infected when\n        your immune system is still relatively healthy, so that you can start taking medications to control the virus\n        before it makes you sick. Also, finding out you are HIV infected allows you to take steps to avoid infecting\n        your sex partners or (for women) to prevent transmission to a fetus or infancy during pregnancy or childbirth.\n\n        The U.S. Centers for Disease Control and Prevention recommend that every adult in the United States be tested\n        for HIV at least once. The VHA recommends that voluntary HIV testing be provided to all patients who receive\n        medical care, and encourages all Veterans to be tested.\n      </div>\n    </div>\n  </div>\n  <br />\n  <div class=\"card\">\n    <div class=\"card-header\" id=\"headingFour\">\n      <h5 class=\"mb-0\">\n        <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseFour\" aria-expanded=\"false\"\n          aria-controls=\"collapseFour\">\n          Will HIV medicines cause changes to your fat and stomach?\n        </button>\n      </h5>\n    </div>\n    <div id=\"collapseFour\" class=\"collapse\" aria-labelledby=\"headingFour\" data-parent=\"#collapseFour\">\n      <div class=\"card-body\">\n        No. The only way to know if you are infected with HIV is to get tested.\n\n        Although some people do have a flulike illness around the time they get infected, many do not. Also, even if\n        you have a flulike illness from HIV, it's usually pretty difficult to tell it apart from ... the flu. So, even\n        people who have the symptoms of HIV infection may think they just have the flu.\n\n        Many people with HIV infection, including those with AIDS, don't feel or look sick in any way. They find out\n        that they are HIV infected only when they get tested. Sometimes this testing is done as part of routine health\n        exams, like getting your cholesterol checked. Other times, people get tested only when they suddenly become\n        seriously ill with a life-threatening infection, and their doctors need to know whether the infection is a\n        result of a weakened immune system caused by HIV.\n\n        Getting tested for HIV is crucial for protecting your health. It's better to find out you are HIV infected when\n        your immune system is still relatively healthy, so that you can start taking medications to control the virus\n        before it makes you sick. Also, finding out you are HIV infected allows you to take steps to avoid infecting\n        your sex partners or (for women) to prevent transmission to a fetus or infancy during pregnancy or childbirth.\n\n        The U.S. Centers for Disease Control and Prevention recommend that every adult in the United States be tested\n        for HIV at least once. The VHA recommends that voluntary HIV testing be provided to all patients who receive\n        medical care, and encourages all Veterans to be tested.\n      </div>\n    </div>\n  </div>\n  <br />\n  <div class=\"card\">\n    <div class=\"card-header\" id=\"headingFive\">\n      <h5 class=\"mb-0\">\n        <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseFive\" aria-expanded=\"false\"\n          aria-controls=\"collapseFive\">\n          I was just diagnosed with HIV and my clinician wants me to start treatment right away. Does that sound like\n          the right thing to do?\n        </button>\n      </h5>\n    </div>\n    <div id=\"collapseFive\" class=\"collapse\" aria-labelledby=\"headingFive\" data-parent=\"#accordion\">\n      <div class=\"card-body\">\n        You may know that we currently recommend HIV treatment (called antiretroviral therapy, or ART) for everyone\n        with HIV. That's because research studies show that effective ART improves the health of people with HIV no\n        matter the stage of their infection, and it enormously reduces the chance of HIV passing to an HIV-negative sex\n        partner. So, all HIV providers almost always offer ART during one of the first clinic visits.\n\n        Some clinics and some local health departments go further and recommend that people with a new diagnosis of HIV\n        start treatment immediately, either that same day or within the next few days. This approach sometimes is\n        called \"Treatment on Diagnosis\" or \"Rapid ART.\" There are several reasons for starting treatment at the time of\n        HIV diagnosis, but the basic reason is that if early treatment is beneficial, starting treatment at the\n        earliest possible time may be even better, and patients may get the benefits of ART sooner. This may be\n        especially true for people who are diagnosed very soon after they are infected (during the acute HIV infection\n        period). Also, we know that delays or barriers to getting clinic appointments are common, and it may take a\n        while to get a prescription for ART, which can result in worse health outcomes. So, strategies that get newly\n        diagnosed people straight into care and onto treatment may bypass these barriers.\n\n        For individuals with new diagnoses of HIV who are starting ART immediately, clinicians must choose the\n        treatment regimens carefully, and offer extra support and guidance. Please discuss this more with your health\n        care provider and decide whether you are ready to start treatment. Remember that this is your decision and you\n        should be comfortable with it.\n      </div>\n    </div>\n  </div>\n</div>"

